	('inbox/LukasSeidel_Q4qeHNONOg', 'Hallo Christian,\n\nDu hattest um ein Feedback zu Deiner Gruppe ‚ÄûCreate Yourself Motivation & Inspiration‚Äú gebeten. Gerne m√∂chte ich Dir diesen ‚ÄöWunsch‚Äò erf√ºllen und hoffe dabei, dass ein ehrliches Feedback das ist, was Du m√∂chtest.\n\nErst einmal vorweg: Du sagtest, dass ihr die Gruppe erst k√ºrzlich ins Leben gerufen habt: Jetzt hat sie bereits √ºber 13.000 Mitglieder. Das ist schon einmal beachtlich.\n\n10 Admins und 38 Moderatoren sind eine ziemlich gro√üe Gruppe an einflussnehmenden Personen. Aber bei der Gruppengr√∂√üe sicherlich auch hilfreich.\n\nWas mir eingangs fehlt ist die Beschreibung der Gruppe, die ich auch nach l√§ngerem Suchen nicht finden konnte. \n\nQuasi ein Aufh√§ngertext: \nWas macht diese Gruppe aus? Worum geht es in dieser Gruppe? Was ist der Mehrwert, den sie mir als Mitglied bietet? \n\nWeiter fehlen mir Hinweise in folgender Richtung:ÔøΩWer postet in dieser Gruppe? Wer darf Beitr√§ge schrieben und hinzuf√ºgen? Zu welchen Themen gibt es Beitr√§ge?\n\nIm Titelbild sind jede Menge verschiedene Bilder, die mich als Mitglied in verschiedene Richtungen lenken: \n- Ein Bild mit Getr√§nken in einem Glas\n- Ein Bild mit einem Salat\n- Ein Bild mit Getr√§nken und Salat\n- Ein Bild mit mehreren Personen am Strand\n- Ein Bild im Fitness-Studio\n- Ein Bild mit Personen beim Sport\n- Ein Bild mit einer Frau mit langen Haaren\n- Ein Bild mit einem Cocktail\n\nDaraus leitet sich mir die Frage (ohne Aufh√§ngertext) ab: Wof√ºr steht die Gruppe konkret?\n\nDas erstmal als erstes kleines Feedback. Entschuldige, wenn das vielleicht zu kritisch r√ºberkommt.\n\nLG ÔøΩL', 'Lukas Seidel', 1536226923903, 'Generic'),
